const CourseList = () => {
  return (
    <div>
      <h1>Course List</h1>
      <ul>
        <l>
            Title
        </l>
        <l>
            Description
        </l>
        <l>
            Instructor
        </l>
      </ul>
    </div>
  );
};

export default CourseList;
